import React from 'react'
import './style/myabout.css'
function Myabout() {
    const img = '/assets/myphoto.jpg';
  return (
    <div>
        <div className='profile_img'> 
            <img src={img} alt='profile'/>
        </div>

    </div>
  )
}

export default Myabout
